#
# Structure for table "gs_notice"
#

DROP TABLE IF EXISTS `gs_notice`;
CREATE TABLE `gs_notice` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '公告显示的id',
  `content` text COMMENT '公告内容',
  `date` int(11) DEFAULT NULL COMMENT '公告时间',
  `title` varchar(120) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

#
# Data for table "gs_notice"
#

INSERT INTO `gs_notice` VALUES (3,'\t\t\t\t\t\t\t\t\t\t富贵鸡2017年3月8号上午10点正式开盘，大家可以注册参与到富贵鸡这款游戏当中。注：账号必须手机号，姓名一定要真实（钱是下发到银行卡的所以名字一定要真实）注册好以后一定要到个人中心完善好资料，了解了界面操作再开始游戏，有什么不知道得可以咨询自己的推荐人\t\t\t\t\t\t',1488938886,'开盘，开盘！！！'),(4,' 1.微信支付首选支付方式,长按二维码就可以识别【尽量少用信用卡支付，支付宝微信比较严格会被警告套现】2.支付宝支付。选择支付宝支付跳转出二维码然后保存该二维码，进入支付宝点开扫一扫，扫描保存的二维码图片即可【时间过期二维码失效交易失败需要重新截图支付]3.出金必须实名绑定银行卡，认真准确填写资料. 注意——以上所有问题均可与富贵鸡客服联系!（微信：s15102790775）',1488972816,'关于充值和出金的说明. '),(5,'\t\t\t\t\t\t\t\t\t\t1.出金提现每笔收5元手续费（第三方支付收取）2.出金时间安排，工作时间9.30--17.30内当天到账，非工作时间内出金24小时到账。\t\t\t\t\t',1489127053,'出金细则');

#
# Structure for table "gs_resource_log"
#

DROP TABLE IF EXISTS `gs_resource_log`;
CREATE TABLE `gs_resource_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userid` int(11) NOT NULL COMMENT '使用者',
  `type` int(11) NOT NULL COMMENT '1激活码 2私聊',
  `counts` int(1) NOT NULL DEFAULT '1' COMMENT '使用数量',
  `create_time` int(11) NOT NULL COMMENT '时间',
  `touserid` int(11) NOT NULL COMMENT '对谁使用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=600 DEFAULT CHARSET=utf8 COMMENT='资源使用记录';

